n//   );\n// };\n\n// \u5224\u65ad\u5143\u7d20\u662f\u5426\u53ef\u89c1\nexport function isInViewPort(el: HTMLElement) {\n  if (!el) {\n    return undefined;\n  }\n\n  const viewPortWidth =\n    window.innerWidth ||\n    document.documentElement.clientWidth ||\n    document.body.clientWidth;\n  const viewPortHeight =\n    window.innerHeight ||\n    document.documentElement.clientHeight ||\n    document.body.clientHeight;\n  const rect = el.getBoundingClientRect();\n\n  if (rect) {\n    const { top, bottom, left, right } = rect;\n    return (\n      bottom > 0 && top <= viewPortHeight && left <= viewPortWidth && right > 0\n    );\n  }\n\n  return false;\n}",z="import { useResizeObserver } from '../../';\nimport { useState } from 'react';\nimport { BasicTarget } from '../../common/interface';\n\nexport type Size = { width: number; height: number };\n\nfunction useSize(target: BasicTarget) {\n  const [state, setState] = useState<Size>({\n    width: 0,\n    height: 0,\n  });\n  useResizeObserver(target, (entry) => {\n    setState({\n      width: (entry.target as HTMLElement).offsetWidth,\n      height: (entry.target as HTMLElement).offsetHeight,\n    });\n  });\n  return state;\n}\n\nexport default useSize;",U="import { Fn } from '@/common/interface';\nimport { useMemo, useRef } from 'react';\n\nconst usePersistFn = <T extends Fn = Fn>(fn: T) => {\n  const fnRef = useRef<T>();\n  fnRef.current = useMemo(() => fn, [fn]);\n  const persistFn = useRef((...args) => {\n    return fnRef.current(...args);\n  });\n  return persistFn.current as T;\n};\nexport default usePersistFn;",B="/**\n *\n * title: \u57fa\u672c\u7528\u6cd5\n * desc: |\n * \u7b80\u5355\u793a\u4f8b\n *\n */\nimport React, {\n  createContext,\n  Dispatch,\n  useContext,\n  useReducer,\n  useState,\n} from 'react';\n\nconst UserContext = createContext(null);\nexport interface IState {\n  theme: string;\n}\nconst initState: IState = {\n  theme: 'dark',\n};\n\nexport type Action = { type: 'fresh' };\n\ninterface Context {\n  state: IState;\n  dispatch: Dispatch<Action>;\n}\n\nconst reducer = (state: IState, action) => {\n  switch (action.type) {\n    case 'changeTheme':\n      return {\n        ...state,\n        theme: action.value,\n      };\n    default:\n      return state;\n  }\n};\n\nfunction Component1() {\n  let [state, dispatch] = useReducer(reducer, initState);\n  console.log(UserContext);\n  return (\n    <UserContext.Provider value={{ state, dispatch }}>\n      <h1>{`Hello ${state.theme}!`}</h1>\n      <input\n        defaultValue={state.theme}\n        onChange={(e) =>\n          dispatch({ type: 'changeTheme', value: e.target.value })\n        }\n      ></input>\n      <Component2 />\n    </UserContext.Provider>\n  );\n}\n\nfunction Component2() {\n  return (\n    <>\n      <h1>Component 2</h1>\n      <Component3 />\n    </>\n  );\n}\n\nfunction Component3() {\n  return (\n    <>\n      <h1>Component 3</h1>\n      <Component4 />\n    </>\n  );\n}\n\nfunction Component4() {\n  return (\n    <>\n      <h1>Component 4</h1>\n      <Component5 />\n    </>\n  );\n}\n\nfunction Component5() {\n  const { state, dispatch } = useContext(UserContext);\n\n  return (\n    <>\n      <h1>Component 5</h1>\n      <input\n        defaultValue={state.theme}\n        onChange={(e) =>\n          dispatch({ type: 'changeTheme', value: e.target.value })\n        }\n      ></input>\n      <h2>{`Hello ${state.theme} again!`}</h2>\n    </>\n  );\n}\nexport default Component1;",V="/**\n *\n * title: \u57fa\u672c\u7528\u6cd5\n * desc: |\n * \u7b80\u5355\u793a\u4f8b\n *\n */\nimport React, { createContext } from 'react';\nimport initContext from '..';\n\nconst UserContext = createContext(null);\nexport interface IState {\n  theme: string;\n}\nconst initialState: IState = {\n  theme: 'dark',\n};\n\nconst { Provider, useStore } = initContext(initialState);\n\nfunction Component1() {\n  return (\n    <Provider>\n      <Component2 />\n    </Provider>\n  );\n}\n\nfunction Component2() {\n  console.log('Component2 render');\n  return (\n    <>\n      <h1>Component 2</h1>\n      <Component3 />\n    </>\n  );\n}\n\nfunction Component3() {\n  const { store, setStore } = useStore((store) => store);\n  console.log('Component3 render');\n  return (\n    <>\n      <h1>Component 3</h1>\n      <input\n        value={store.theme}\n        onChange={(e) => setStore({ theme: e.target.value })}\n      ></input>\n      <Component4 />\n    </>\n  );\n}\n\nfunction Component4() {\n  return (\n    <>\n      <h1>Component 4</h1>\n      <Component5 />\n    </>\n  );\n}\n\nfunction Component5() {\n  const { store, setStore } = useStore((store) => store);\n  console.log('Component5 render');\n\n  return (\n    <>\n      <h1>Component 5</h1>\n      <input\n        value={store.theme}\n        onChange={(e) => setStore({ theme: e.target.value })}\n      ></input>\n      <h2>{`Hello ${store.theme} again!`}</h2>\n    </>\n  );\n}\nexport default Component1;",H="import { isEqual } from '../../common/utils';\nimport React, {\n  createContext,\n  useContext,\n  useLayoutEffect,\n  useRef,\n  useState,\n} from 'react';\nimport usePersistFn from '../usePersistFn';\nimport useUpdate from '../useUpdate';\n\ninterface ContextProps<T> {\n  children: React.ReactNode | ((value: T) => React.ReactNode);\n}\n\ninterface Context<T> {\n  store: T;\n  setStore: (value: T) => void;\n  listeners: Listener<T>;\n}\ntype Listener<T> = Set<(value: Partial<T>) => void>;\n\nfunction initContext<T extends object>(initialState: T) {\n  const Context = createContext<Context<T>>(null);\n  return {\n    Provider: React.memo(({ children }: ContextProps<T>) => {\n      const [value, setValue] = useState(initialState);\n      const listeners = useRef<Listener<T>>(new Set()).current;\n      const setStore = usePersistFn((nextStore: T) => {\n        setValue(nextStore);\n        for (let l of listeners) {\n          l(nextStore);\n        }\n      });\n      return (\n        <Context.Provider\n          value={{ store: value, setStore, listeners: listeners }}\n        >\n          {typeof children === 'function' ? children(value) : children}\n        </Context.Provider>\n      );\n    }),\n    useStore: <D extends Partial<T>>(selector: (value: T) => D) => {\n      const forceUpdate = useUpdate();\n      const { store, setStore, listeners } = useContext<Context<T>>(Context);\n      const selectedStore = selector(store);\n      const cb = usePersistFn((nextStore: T) => {\n        for (let key in selectedStore) {\n          if (\n            !isEqual(selectedStore[key], nextStore[key as unknown as keyof T])\n          ) {\n            forceUpdate();\n            break;\n          }\n        }\n      });\n      useLayoutEffect(() => {\n        listeners.add(cb);\n        return () => {\n          listeners.delete(cb);\n        };\n      }, []);\n\n      return { store: selectedStore, setStore };\n    },\n  };\n}\nexport default initContext;",K="import { SetStateAction } from './interface';\n\n// /**\n//  * @desc: obj1\u7684keys\u6839\u636eobj2\u7684keys\u5224\u65ad\n//  * 1.obj2\u7684key\u4e0d\u5b58\u5728\u5219\u53d6\u53e6\u4e00\u4e2a\u5bf9\u8c61\u7684value\uff0c\n//  * 2.\u53e6\u4e00\u4e2a\u5bf9\u8c61\u7684keys\u4f1a\u88ab\u5220\u9664\u3002\n//  * @example\n//  * params:{a:1,b:2,c:3} ,{a:2,d:4}\n//  * result:{a:1,d:4}\n//  */\n// export const unionKeys = (obj1, obj2): typeof obj2 => {\n//   const res = {};\n//   for (let key in obj2) {\n//     const obj1Value = obj1[key];\n//     res[key] = obj1Value === undefined ? obj2[key] : obj1Value;\n//   }\n//   return res;\n// };\n\nexport const isValue = <T>(state: SetStateAction<T>): state is T => {\n  return typeof state !== 'function';\n};\n\nexport const setStateAction = <T>(v: SetStateAction<T>, prev: T): T => {\n  if (isValue<T>(v)) {\n    return v;\n  }\n  return v(prev);\n};\n\n// \u6570\u5b57\u8f6cpx\nexport function numToPx(number: number): string {\n  if (number) {\n    return `${number}px`;\n  }\n  return '';\n}\n// px\u8f6c\u6570\u5b57\nexport function pxToNum(str: string): number {\n  if (str) {\n    return parseInt(str.slice(0, -2), 10);\n  }\n  return 0;\n}\n\nexport function mergeWith(obj, source, customizer) {\n  for (let i in obj) {\n    if (Object.prototype.hasOwnProperty.call(obj, i)) {\n      obj[i] = customizer(obj[i], source[i]);\n    }\n  }\n  return obj;\n}\n\nexport function isNumber(value) {\n  return typeof value === 'number';\n}\n\nexport function isObject(obj) {\n  return Object.prototype.toString.call(obj) === '[object Object]';\n}\n\n// \u5224\u65ad\u5bf9\u8c61\u662f\u5426\u76f8\u540c\nexport function isEqual(obj1, obj2) {\n  // 1.\u5224\u65ad\u662f\u4e0d\u662f\u5f15\u7528\u7c7b\u578b\uff0c\u4e0d\u662f\u5f15\u7528\n  if (!isObject(obj1) || !isObject(obj2)) {\n    return obj1 === obj2;\n  }\n  // 2.\u6bd4\u8f83\u662f\u5426\u4e3a\u540c\u4e00\u4e2a\u5185\u5b58\u5730\u5740\n  if (obj1 === obj2) return true;\n  // 3.\u6bd4\u8f83 key \u7684\u6570\u91cf\n  const obj1KeysLength = Object.keys(obj1).length;\n  const obj2KeysLength = Object.keys(obj2).length;\n  if (obj1KeysLength !== obj2KeysLength) return false;\n  // 4.\u6bd4\u8f83 value \u7684\u503c\n  for (let key in obj1) {\n    if (Object.prototype.hasOwnProperty.call(obj1, key)) {\n      const result = isEqual(obj1[key], obj2[key]);\n      if (!result) return false;\n    }\n  }\n  return true;\n}\n\n// \u5f88\u8d39\u6027\u80fd\uff0c\u614e\u91cd\u7528\nexport const dataType = (val: any): string => {\n  return Object.prototype.toString\n    .call(val)\n    .replace(/^.{8}(.+)]$/, (m, $1) => $1.toLowerCase());\n};\n\nexport const mockInt = (minNum, maxNum) => {\n  return parseInt(Math.random() * (maxNum - minNum + 1) + minNum, 10);\n};\n\nexport const setInitialState = <T>(v: T | (() => T)): T => {\n  if (isValue<T>(v)) {\n    return v;\n  }\n  return v();\n};\n\nexport function pick<T extends object, U extends keyof T>(\n  origin: T,\n  keys: U[],\n): Pick<T, U> {\n  const empty = {} as Pick<T, U>;\n  if (!origin) {\n    return empty;\n  }\n  return Object.assign(empty, ...keys.map((key) => ({ [key]: origin[key] })));\n}",q="import { useState } from 'react';\nimport usePersistFn from '../usePersistFn';\nconst useUpdate = () => {\n  const [, setState] = useState({});\n  return usePersistFn(() => {\n    setState({});\n  });\n};\nexport default useUpdate;",$="import React, { useRef } from 'react';\nimport { useElementIsScroll } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef();\n  const isScrollState = useElementIsScroll(() => {\n    return document.getElementById('button');\n  });\n\n  return (\n    <>\n      <p>x : {isScrollState.x.toString()}</p>\n      <p>y : {isScrollState.y.toString()}</p>\n      <div\n        id=\"button\"\n        ref={ref}\n        style={{\n          height: 100,\n          width: 200,\n          border: '1px solid',\n          overflow: 'scroll',\n          resize: 'both',\n        }}\n      >\n        <div style={{ height: 200, width: 400 }}>test</div>\n      </div>\n    </>\n  );\n};",W="import React, { useState, useRef } from 'react';\nimport { useEventListener } from 'wwhooks';\n\nexport default () => {\n  const [value, setValue] = useState(0);\n\n  const clickHandler = () => {\n    setValue(value + 1);\n  };\n\n  const ref = useRef();\n  useEventListener(ref, 'click', clickHandler);\n\n  return (\n    <button ref={ref} type=\"button\">\n      You click {value} times\n    </button>\n  );\n};",G="import React, { useState } from 'react';\nimport { useEventListener } from 'wwhooks';\n\nexport default () => {\n  const [value, setValue] = useState('');\n\n  const keyDownHandler = (ev: KeyboardEvent) => {\n    setValue(ev.code);\n  };\n  useEventListener(window, 'keydown', keyDownHandler);\n\n  return <p>Your press key is {value}</p>;\n};",Y="import React from 'react';\nimport { useHash } from 'wwhooks';\n\nexport default () => {\n  const [state, setState, reset] = useHash('123');\n  return (\n    <>\n      <div>state: {JSON.stringify(state)}</div>\n      <button\n        type=\"button\"\n        onClick={() => setState((prev) => `${prev ?? ''}1`)}\n      >\n        add\n      </button>\n      <button type=\"button\" onClick={reset}>\n        reset\n      </button>\n      <button type=\"button\" onClick={() => setState(null)}>\n        clear\n      </button>\n    </>\n  );\n};",J="/**\n *\n * title: \u57fa\u672c\u7528\u6cd5\n * desc: |\n * \u7b80\u5355\u793a\u4f8b\n *\n */\nimport React, { useRef } from 'react';\nimport { useHover } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef(null);\n  const isHovering = useHover(ref);\n  return <button ref={ref}>{isHovering ? 'hover' : 'unHover'}</button>;\n};",X="import React, { useRef, useState } from 'react';\nimport { useIntersectionObserver } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef();\n  const [visible, setVisible] = useState(false);\n  useIntersectionObserver(ref, (entry) => {\n    setVisible(entry.isIntersecting);\n  });\n  return (\n    <div>\n      <div style={{ height: 200, width: 200, overflow: 'scroll' }}>\n        <div ref={ref}>Top </div>\n        <div style={{ height: 300 }}>fill</div>\n      </div>\n      <div>\n        <p>visible:{visible.toString()}</p>\n      </div>\n    </div>\n  );\n};",Q="import React, { useState } from 'react';\nimport { useIntersectionObserver, useToggle } from 'wwhooks';\n\nexport default () => {\n  const [id, toggleId] = useToggle('top', 'bottom');\n  const [visible, setVisible] = useState(false);\n  useIntersectionObserver(\n    () => document.getElementById(id),\n    (entry) => {\n      setVisible(entry.isIntersecting);\n    },\n  );\n\n  return (\n    <div>\n      <div style={{ height: 200, width: 200, overflow: 'scroll' }}>\n        <div id=\"top\">Top </div>\n        <div style={{ height: 300 }} />\n        <div id=\"bottom\">bottom </div>\n      </div>\n      <div>\n        <button onClick={() => toggleId()}>toggleRef</button>\n        <p>visible:{visible.toString()}</p>\n        <p>id:{id}</p>\n      </div>\n    </div>\n  );\n};",ee="import React, { useState } from 'react';\nimport useIntervalFn from '..';\nexport default () => {\n  const [count, setCount] = useState<number>(0);\n  const { start, clear, looping } = useIntervalFn(() => {\n    setCount((v) => ++v);\n  }, 100);\n  return (\n    <div>\n      <p>count : {count}</p>\n      <p>looping:{JSON.stringify(looping)}</p>\n      <p>\n        <button type=\"button\" onClick={() => start()}>\n          start\n        </button>\n        <button type=\"button\" onClick={() => clear()}>\n          clear\n        </button>\n      </p>\n    </div>\n  );\n};",te="import { useRef, useState } from 'react';\nimport usePersistFn from '../usePersistFn';\nimport useUnmount from '../useUnmount';\n\nfunction useIntervalFn(fn: () => void, delay: number) {\n  const timerId = useRef<any>(null);\n  const [looping, setLooping] = useState(false);\n  const callback = usePersistFn(() => {\n    fn();\n    timerId.current = setTimeout(callback, delay);\n  });\n  const clear = usePersistFn(() => {\n    clearTimeout(timerId.current);\n    setLooping(false);\n  });\n\n  const start = usePersistFn(() => {\n    if (looping) {\n      return;\n    }\n    setTimeout(callback, delay);\n    setLooping(true);\n  });\n  useUnmount(() => {\n    clear();\n  });\n\n  return {\n    start,\n    clear,\n    looping,\n  };\n}\n\nexport default useIntervalFn;",ne="import { useEffect } from 'react';\n\nconst useUnmount = (fn: () => void) => {\n  useEffect(() => {\n    return fn;\n  }, []);\n};\n\nexport default useUnmount;",re="import React, { useRef } from 'react';\nimport { useLockScroll } from 'wwhooks';\n\nexport default () => {\n  const domRef = useRef<HTMLDivElement>();\n  const [toggle, lockState] = useLockScroll(domRef.current);\n  const [toggleBody, lockBodyState] = useLockScroll();\n  return (\n    <>\n      <p>\n        <button onClick={() => toggle()}>lock:{lockState.toString()}</button>\n        <button onClick={() => toggleBody()}>\n          lockBody:{lockBodyState.toString()}\n        </button>\n      </p>\n\n      <div\n        style={{ height: 400, overflow: 'auto', border: `1px solid black` }}\n        ref={domRef}\n      >\n        <div style={{ height: 1000 }} />\n      </div>\n    </>\n  );\n};",ae="import React, { useState } from 'react';\nconst test = (props) => {\n  const [map, setMap] = useState<Map<any, any>>(new Map([[1, 2]]));\n  console.log(map);\n  return (\n    <>\n      <p>{Array(map)}</p>\n      <p>\n        <button\n          onClick={() => {\n            const newMap = map.set('key', 'value');\n            console.log(newMap);\n            setMap(newMap);\n          }}\n        >\n          add\n        </button>\n      </p>\n    </>\n  );\n};\nexport default test;",oe="import React from 'react';\nimport { useBoolean, useMount } from 'wwhooks';\nimport { message } from 'antd';\n\nconst Component = () => {\n  useMount(() => {\n    message.success('mount');\n  });\n  return <span>Hello World</span>;\n};\n\nexport default () => {\n  const [state, toggle] = useBoolean(false);\n\n  return (\n    <>\n      <button type=\"button\" onClick={() => toggle()}>\n        {state ? 'unmount' : 'mount'}\n      </button>\n      {state && <Component />}\n    </>\n  );\n};",le="import React, { useState } from 'react';\nimport { useBoolean, useUnmount, useMountedState } from 'wwhooks';\n\n// \u4e0d\u4f1a\u51fa\u73b0\u5185\u5b58\u6cc4\u6f0f\nconst Component = () => {\n  const [state, setState] = useState('mounted');\n  const mounted = useMountedState();\n  useUnmount(() => {\n    setTimeout(() => {\n      mounted() && setState('Unmount');\n    }, 1000);\n  });\n  return <input value={state} onChange={(e) => setState(e.target.value)} />;\n};\n\nexport default () => {\n  const [state, toggle] = useBoolean(true);\n  return (\n    <>\n      <p>\n        <button onClick={() => toggle()}>{state ? 'unmount' : 'mount'}</button>\n      </p>\n      {state ? <Component /> : <p>no</p>}\n    </>\n  );\n};",ie="import React, { useRef, useState } from 'react';\nimport useMutationObserver from '..';\n// import { useMutationObserver } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef<HTMLDivElement>();\n  const [info, setInfo] = useState<Object>();\n  const [watch, setState] = useMutationObserver(\n    ref,\n    (mutations: MutationRecord[], observer: MutationObserver) => {\n      for (let mutation of mutations) {\n        const target = mutation.target as HTMLDivElement;\n        setInfo({ ...target.dataset } as typeof info);\n      }\n    },\n  );\n  console.log(info);\n  return (\n    <div>\n      <div>\n        <p>data:{JSON.stringify(info)}</p>\n        <p>\n          watch {watch.toString()}\n          <button onClick={() => setState((v) => !v)}>\n            {watch ? 'stop' : 'watch'}\n          </button>\n        </p>\n        <p>\n          <input\n            onChange={(e) =>\n              ref.current.setAttribute('data-name', e.target.value)\n            }\n          />\n          <input\n            onChange={(e) =>\n              ref.current.setAttribute('data-location', e.target.value)\n            }\n          />\n        </p>\n      </div>\n      <div ref={ref}>ref element </div>\n    </div>\n  );\n};",ue="import { useEffect, useRef, useState } from 'react';\nimport { getTargetElement } from '../../common/dom';\nimport { BasicTarget } from '../../common/interface';\n\nfunction useMutationObserver(\n  target: BasicTarget,\n  callback: MutationCallback,\n  config: MutationObserverInit = {\n    attributes: true,\n    childList: true,\n    subtree: true,\n    characterData: true,\n    attributeOldValue: true,\n  },\n) {\n  const [isObserving, setIsObserving] = useState<boolean>(true);\n  const observer = useRef<MutationObserver>();\n  useEffect(() => {\n    if (isObserving) {\n      const el = getTargetElement(target);\n      if (!el) {\n        return;\n      }\n      observer.current = new MutationObserver(callback);\n      observer.current.observe(el, config);\n    } else {\n      observer.current?.disconnect();\n      observer.current = undefined;\n    }\n    return () => {\n      observer.current?.disconnect();\n      observer.current = undefined;\n    };\n  }, [isObserving]);\n\n  return [isObserving, setIsObserving] as const;\n}\nexport default useMutationObserver;",ce="import React, { useState } from 'react';\nimport { useNumber } from 'wwhooks';\n\nconst test = () => {\n  const [num, action] = useNumber(0);\n  return (\n    <div>\n      {num}\n      <div>\n        <button onClick={() => action.plus(2)}>plus2</button>\n        <button onClick={() => action.minus(1)}>minus1</button>\n        <button onClick={() => action.set(100)}>set100</button>\n        <button onClick={action.reset}>reset</button>\n      </div>\n    </div>\n  );\n};\nexport default test;",se="import React, { useState } from 'react';\nimport { useObject } from 'wwhooks';\n\ninterface Obj {\n  name: string;\n  age: number;\n}\nconst Demo = () => {\n  const [obj, actions] = useObject<Obj>({\n    name: 'bhwa233',\n    age: 25,\n  });\n  return (\n    <div>\n      <p>\n        {(Object.keys(obj) as Array<keyof Obj>).map((key) => {\n          return (\n            <span key={key}>\n              {key} : {obj[key]}\n            </span>\n          );\n        })}\n      </p>\n      <p>isEdited : {actions.isEdited.toString()}</p>\n      <p>\n        <button\n          onClick={() =>\n            actions.set((prev) => ({\n              age: ++prev.age,\n            }))\n          }\n        >\n          age++\n        </button>\n\n        <input\n          value={obj.name}\n          onChange={(e) => {\n            actions.set({ name: e.target.value });\n          }}\n        />\n      </p>\n      <p>\n        <button onClick={actions.reset}>reset</button>\n      </p>\n    </div>\n  );\n};\nexport default Demo;",de="/**\n *\n * title: \u57fa\u672c\u7528\u6cd5\n * desc: |\n * \u7b80\u5355\u793a\u4f8b\n *\n */\nimport { message } from 'antd';\nimport React, { useState } from 'react';\nimport usePersistFn from '..';\nconst Test = (props) => {\n  const [value, setValue] = useState('');\n  const show = usePersistFn((text) => {\n    console.log(value);\n    message.success(value + text);\n  });\n\n  return (\n    <div>\n      <input onChange={(e) => setValue(e.target.value)} />\n      <button onClick={() => show(value)}>usePersistFn</button>\n    </div>\n  );\n};\nexport default Test;",fe="import { message } from 'antd';\nimport React, { useCallback, useRef, useState } from 'react';\nimport { usePersistFn } from 'wwhooks';\n\nexport default () => {\n  const [count, setCount] = useState(0);\n\n  const callbackFn = useCallback(() => {\n    message.info(`Current count is ${count}`);\n  }, [count]);\n\n  const memoizedFn = usePersistFn(() => {\n    message.info(`Current count is ${count}`);\n  });\n\n  return (\n    <>\n      <p>count: {count}</p>\n      <button\n        type=\"button\"\n        onClick={() => {\n          setCount((c) => c + 1);\n        }}\n      >\n        Add Count\n      </button>\n\n      <p>\n        You can click the button to see the number of sub-component renderings\n      </p>\n\n      <div style={{ marginTop: 32 }}>\n        <h3>Component with useCallback function:</h3>\n        {/* use callback function, ExpensiveTree component will re-render on state change */}\n        <ExpensiveTree showCount={callbackFn} />\n      </div>\n\n      <div style={{ marginTop: 32 }}>\n        <h3>Component with usePersistFn function:</h3>\n        {/* use memoized function, ExpensiveTree component will only render once */}\n        <ExpensiveTree showCount={memoizedFn} />\n      </div>\n    </>\n  );\n};\n\n// some expensive component with React.memo\nconst ExpensiveTree = React.memo<any>(({ showCount }) => {\n  const renderCountRef = useRef(0);\n  renderCountRef.current += 1;\n\n  return (\n    <div>\n      <p>Render Count: {renderCountRef.current}</p>\n      <button type=\"button\" onClick={showCount}>\n        showParentCount\n      </button>\n    </div>\n  );\n});",me="import { usePrevious } from 'wwhooks';\nimport React, { useState } from 'react';\n\nexport default () => {\n  const [count, setCount] = useState(0);\n  const previous = usePrevious(count);\n  return (\n    <>\n      <div>state: {count}</div>\n      <div style={{ marginBottom: 8 }}> previous state: {previous}</div>\n      <button type=\"button\" onClick={() => setCount((c) => c + 1)}>\n        increase\n      </button>\n      <button\n        type=\"button\"\n        style={{ marginLeft: 8 }}\n        onClick={() => setCount((c) => c - 1)}\n      >\n        decrease\n      </button>\n    </>\n  );\n};",pe="import React, { useEffect, useState } from 'react';\nimport { useReactive } from 'wwhooks';\n\nconst Test = () => {\n  const list = useReactive([1, 2]);\n  const [count, setCount] = useState(0);\n  useEffect(() => {\n    setCount((v) => v + 1);\n  }, [list.a]);\n  return (\n    <div>\n      <button onClick={() => list.push(list.length + 1)}>push</button>\n      <button onClick={() => list.pop()}>pop</button>\n      <div>{JSON.stringify(list)}</div>\n      <div>{count}</div>\n    </div>\n  );\n};\nexport default Test;",he="import React, { useEffect, useState } from 'react';\nimport { useReactive } from 'wwhooks';\n\nconst Test = () => {\n  let list = useReactive({ a: '' });\n  const [count, setCount] = useState(0);\n  // \u4f1a\u89e6\u53d1\n  useEffect(() => {\n    setCount((v) => v + 1);\n  }, [list.a]);\n  // \u4e0d\u4f1a\u89e6\u53d1\n  useEffect(() => {\n    setCount((v) => v + 100);\n  }, [list]);\n  return (\n    <div>\n      <input\n        onChange={(e) => {\n          list.a = e.target.value;\n        }}\n      />\n      <div>{JSON.stringify(list)}</div>\n      <div>{count}</div>\n    </div>\n  );\n};\nexport default Test;",ve="import React from 'react';\nimport useReactive from '..';\n\nexport default () => {\n  const state = useReactive({\n    list: [{ name: Math.random() }],\n  });\n\n  const changeName = () => {\n    state.list[0].name = Math.random();\n  };\n\n  return (\n    <div>\n      <button onClick={changeName}>\u6539\u53d8\u6570\u636e</button>\n      <div>{JSON.stringify(state.list.map((v) => v.name))}</div>\n    </div>\n  );\n};",ge="import { InitialState, SetStateAction } from '@/common/interface';\nimport { useMemo } from 'react';\nimport useUpdate from '../useUpdate';\n\nfunction isObject(val: Record<string, any>): boolean {\n  return typeof val === 'object' && val !== null;\n}\n\nconst observer = <T extends Record<string, any>>(val, cb) => {\n  const proxy = new Proxy<T>(val, {\n    get(target, key, receiver) {\n      const res = Reflect.get(target, key, receiver);\n      return isObject(res) ? observer(res, cb) : Reflect.get(target, key);\n    },\n    set(target, key, val) {\n      const v = Reflect.set(target, key, val);\n      cb(target);\n      return v;\n    },\n    deleteProperty(target, key) {\n      const v = Reflect.deleteProperty(target, key);\n      cb(v);\n      return v;\n    },\n  });\n  return proxy;\n};\n\nexport const isValue = <T>(state: SetStateAction<T>): state is T => {\n  return typeof state !== 'function';\n};\n\nexport const setState = <T>(v: T | (() => T)): T => {\n  if (isValue<T>(v)) {\n    return v;\n  }\n  return v();\n};\n\nconst useReactive = <T extends Record<string, any>>(\n  InitialState?: InitialState<T>,\n) => {\n  const update = useUpdate();\n  const state = useMemo(() => {\n    return observer(setState(InitialState), () => {\n      update();\n    });\n  }, []);\n  return state as T;\n};\n\nexport default useReactive;",Ee="import React, { useRef } from 'react';\nimport { useResizeObserver } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef();\n  useResizeObserver(ref, (entry) => {\n    console.log(entry);\n  });\n  return (\n    <div\n      ref={ref}\n      style={{\n        height: 100,\n        width: 200,\n        resize: 'both',\n        border: '1px solid',\n        overflow: 'auto',\n      }}\n    ></div>\n  );\n};",ye="import React, { useRef } from 'react';\nimport { useScroll } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef();\n  const position = useScroll(ref);\n  return (\n    <>\n      <p>left:{position.left}</p>\n      <p>top:{position.top}</p>\n      <div\n        ref={ref}\n        style={{\n          maxHeight: 200,\n          maxWidth: 400,\n          border: '1px solid',\n          overflow: 'scroll',\n        }}\n      >\n        <div style={{ height: 1000, width: 2000 }}>test</div>\n      </div>\n    </>\n  );\n};",be="import React, { useRef } from 'react';\nimport { useSize } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef();\n  const { width, height } = useSize(ref);\n  console.log(width, height);\n  return (\n    <div\n      ref={ref}\n      style={{\n        height: 100,\n        width: 200,\n        resize: 'both',\n        border: '1px solid',\n        overflow: 'auto',\n      }}\n    >\n      <p>width:{width}</p>\n      <p>height:{height}</p>\n    </div>\n  );\n};",we="import React, { useRef } from 'react';\nimport { useSize } from 'wwhooks';\n\nexport default () => {\n  const { width, height } = useSize(document.body);\n  return (\n    <div>\n      <p>width:{width}</p>\n      <p>height:{height}</p>\n    </div>\n  );\n};",xe="import React from 'react';\nimport { useLocalStorage } from 'wwhooks';\n\nexport default () => {\n  const [state, setState] = useLocalStorage('string', '123');\n  console.log(state);\n  return (\n    <div>\n      <input\n        value={state || ''}\n        onChange={(e) => {\n          const value = e.target.value;\n          setState(value);\n        }}\n      />\n\n      <button onClick={() => setState()}>clear</button>\n    </div>\n  );\n};",ke="import React from 'react';\nimport { useLocalStorage } from '../..';\n\nexport default () => {\n  const [state, setState] = useLocalStorage('array', ['1', '2', '3']);\n\n  return (\n    <div>\n      {state.map((item, index) => (\n        <p key={index}>\n          <input\n            value={item}\n            onChange={(e) => {\n              const value = e.target.value;\n              setState((list) => {\n                const nextList = [...list];\n                nextList[index] = value;\n                return nextList;\n              });\n            }}\n          />\n        </p>\n      ))}\n    </div>\n  );\n};",Se="/* eslint-disable max-params */\nimport { InitialState } from '../../common/interface';\nimport { setStateAction } from '../../common/utils';\nimport { SetStateAction, useState } from 'react';\nimport usePersistFn from '../usePersistFn';\n\nexport interface Options<T> {\n  serializer?: (value: T) => string;\n  deserializer?: (value: string) => T;\n}\n\nfunction useStorage<T>(\n  key: string,\n  defaultValue?: InitialState<T>,\n  options?: Options<T>,\n  storage: Storage = sessionStorage,\n) {\n  const serializer = (value: T) => {\n    if (options?.serializer) {\n      return options?.serializer(value);\n    }\n    return JSON.stringify(value);\n  };\n\n  const deserializer = (value: string) => {\n    if (options?.deserializer) {\n      return options?.deserializer(value);\n    }\n    return JSON.parse(value);\n  };\n  const getStorageValue = usePersistFn(() => {\n    try {\n      const rawValue = storage.getItem(key);\n      if (rawValue !== null) {\n        return deserializer(rawValue);\n      }\n    } catch (e) {\n      console.error(e);\n    }\n    return defaultValue;\n  });\n\n  const [state, setState] = useState<T>(() => getStorageValue());\n\n  const setStorageState = usePersistFn((nextState?: SetStateAction<T>) => {\n    try {\n      const nextValue = setStateAction(nextState, state);\n      setState(nextValue);\n      if (nextValue === undefined) {\n        storage.removeItem(key);\n      } else {\n        storage.setItem(key, serializer(nextValue));\n      }\n    } catch (e) {\n      console.error(e);\n    }\n  });\n\n  return [state, setStorageState] as const;\n}\n\nfunction useLocalStorage<T>(\n  key: string,\n  defaultValue?: InitialState<T>,\n  options?: Options<T>,\n) {\n  return useStorage(key, defaultValue, options, localStorage);\n}\n\nfunction useSessionStorage<T>(\n  key: string,\n  defaultValue?: InitialState<T>,\n  options?: Options<T>,\n) {\n  return useStorage(key, defaultValue, options);\n}\n\nexport { useLocalStorage, useSessionStorage };",Ce="import React from 'react';\nimport { useSessionStorage } from 'wwhooks';\n\nexport default () => {\n  const [state, setState] = useSessionStorage('string', '123');\n  console.log(state);\n  return (\n    <div>\n      <input\n        value={state || ''}\n        onChange={(e) => {\n          const value = e.target.value;\n          setState(value);\n        }}\n      />\n\n      <button onClick={() => setState()}>clear</button>\n    </div>\n  );\n};",Ne="import React from 'react';\nimport { useSessionStorage } from '../..';\n\nexport default () => {\n  const [state, setState] = useSessionStorage('array', ['1', '2', '3']);\n  return (\n    <div>\n      {state?.map((item, index) => (\n        <p key={index}>\n          <input\n            value={item}\n            onChange={(e) => {\n              const value = e.target.value;\n              setState((list) => {\n                const nextList = [...list];\n                nextList[index] = value;\n                return nextList;\n              });\n            }}\n          />\n        </p>\n      ))}\n    </div>\n  );\n};",Pe="/**\n *\n * title: \u57fa\u672c\u7528\u6cd5\n * desc: |\n * \u7b80\u5355\u793a\u4f8b\n *\n */\nimport React, {\n  createContext,\n  Dispatch,\n  useContext,\n  useReducer,\n  useState,\n} from 'react';\n\nconst UserContext = createContext(null);\nexport interface IState {\n  theme: string;\n}\nconst initState: IState = {\n  theme: 'dark',\n};\n\nexport type Action = { type: 'fresh' };\n\ninterface Context {\n  state: IState;\n  dispatch: Dispatch<Action>;\n}\n\nconst reducer = (state: IState, action) => {\n  switch (action.type) {\n    case 'changeTheme':\n      return {\n        ...state,\n        theme: action.value,\n      };\n    default:\n      return state;\n  }\n};\n\nfunction Component1() {\n  let [state, dispatch] = useReducer(reducer, initState);\n  console.log(UserContext);\n  return (\n    <UserContext.Provider value={{ state, dispatch }}>\n      <h1>{`Hello ${state.theme}!`}</h1>\n      <input\n        defaultValue={state.theme}\n        onChange={(e) =>\n          dispatch({ type: 'changeTheme', value: e.target.value })\n        }\n      ></input>\n      <Component2 />\n    </UserContext.Provider>\n  );\n}\n\nfunction Component2() {\n  return (\n    <>\n      <h1>Component 2</h1>\n      <Component3 />\n    </>\n  );\n}\n\nfunction Component3() {\n  return (\n    <>\n      <h1>Component 3</h1>\n      <Component4 />\n    </>\n  );\n}\n\nfunction Component4() {\n  return (\n    <>\n      <h1>Component 4</h1>\n      <Component5 />\n    </>\n  );\n}\n\nfunction Component5() {\n  const { state, dispatch } = useContext(UserContext);\n\n  return (\n    <>\n      <h1>Component 5</h1>\n      <input\n        defaultValue={state.theme}\n        onChange={(e) =>\n          dispatch({ type: 'changeTheme', value: e.target.value })\n        }\n      ></input>\n      <h2>{`Hello ${state.theme} again!`}</h2>\n    </>\n  );\n}\nexport default Component1;",Oe="/**\n *\n * title: \u57fa\u672c\u7528\u6cd5\n * desc: |\n * \u7b80\u5355\u793a\u4f8b\n *\n */\nimport useNumber from '@/hooks/useNumber';\nimport React, {\n  createContext,\n  Dispatch,\n  useContext,\n  useReducer,\n  useState,\n} from 'react';\nimport initContext from '..';\n\nconst UserContext = createContext(null);\nexport interface IState {\n  theme: string;\n}\nconst initialState: IState = {\n  theme: 'dark',\n};\nfunction useCounter() {\n  const [store, setStore] = useState(initialState);\n  return {\n    store,\n    setStore,\n  };\n}\nconst { Provider, useStore } = initContext(useCounter);\n\nfunction Component1() {\n  return (\n    <Provider>\n      <Component2 />\n    </Provider>\n  );\n}\n\nfunction Component2() {\n  console.log('Component2 render');\n  return (\n    <>\n      <h1>Component 2</h1>\n      <Component3 />\n    </>\n  );\n}\n\nfunction Component3() {\n  const { store } = useStore((store) => store);\n  return (\n    <>\n      <h1>Component 3</h1>\n      {store.theme}\n      <Component4 />\n    </>\n  );\n}\n\nfunction Component4() {\n  return (\n    <>\n      <h1>Component 4</h1>\n      <Component5 />\n    </>\n  );\n}\n\nfunction Component5() {\n  const { store, setStore } = useStore((store) => store);\n  console.log(store);\n  return (\n    <>\n      <h1>Component 5</h1>\n      {store.theme}\n      <button type=\"button\" onClick={() => setStore({ theme: 'red' })}>\n        red\n      </button>\n      <button type=\"button\" onClick={() => setStore({ theme: 'yellow' })}>\n        yellow\n      </button>\n    </>\n  );\n}\nexport default Component1;",Ae="import { isEqual, pick } from '../../common/utils';\nimport React, {\n  createContext,\n  useContext,\n  useEffect,\n  useLayoutEffect,\n} from 'react';\nimport usePersistFn from '../usePersistFn';\nimport useUpdate from '../useUpdate';\n\ninterface ContextProps<V, T> {\n  children: React.ReactNode | ((value: V) => React.ReactNode);\n  initialState?: T;\n}\n\ninterface Context<V> {\n  value: V;\n  listeners: Listener<V>;\n}\ntype Listener<T> = Set<(value: Partial<T>) => void>;\n\nfunction initContext<V extends object, T extends object>(\n  useHook: (initialState?: T) => V,\n) {\n  const Context = createContext<Context<V>>(null);\n  const Provider = React.memo(\n    ({ children, initialState }: ContextProps<V, T>) => {\n      const value = useHook(initialState);\n      const store = React.useRef<Context<V>>({\n        value,\n        listeners: new Set(),\n      }).current;\n      store.value = value;\n      useEffect(() => {\n        for (let listener of store.listeners) {\n          listener(value);\n        }\n      });\n      return (\n        <Context.Provider value={store}>\n          {typeof children === 'function' ? children(store.value) : children}\n        </Context.Provider>\n      );\n    },\n  );\n  const useStore = (selector: (value: V) => Partial<V>) => {\n    const forceUpdate = useUpdate();\n    const { value, listeners } = useContext<Context<V>>(Context);\n    const selectedStore = selector(value);\n    const cb = usePersistFn((nextStore: T) => {\n      for (let key in selectedStore) {\n        if (\n          !isEqual(selectedStore[key], nextStore[key as unknown as keyof T])\n        ) {\n          forceUpdate();\n          break;\n        }\n      }\n    });\n    useLayoutEffect(() => {\n      listeners.add(cb);\n      return () => {\n        listeners.delete(cb);\n      };\n    }, []);\n    return selectedStore;\n  };\n  const usePicker = (keys: (keyof V)[]) => {\n    return useStore((state) => pick(state, keys));\n  };\n\n  const withPicker = <T extends object>(\n    Child: React.FC<T & Partial<V>>,\n    keys: (keyof V)[],\n  ) => {\n    return (props: T) => {\n      const picked = usePicker(keys);\n      return <Child {...{ ...picked, ...props }} />;\n    };\n  };\n\n  return {\n    Provider,\n    useStore,\n    usePicker,\n    withPicker,\n  };\n}\nexport default initContext;",_e="import React, { forwardRef, useRef, useState } from 'react';\nimport { useSyncScroll } from 'wwhooks';\n\nconst Box = forwardRef<HTMLDivElement, { color: string }>(({ color }, ref) => {\n  return (\n    <div\n      ref={ref}\n      style={{\n        height: 100,\n        width: 200,\n        overflow: 'auto',\n        border: '1px solid ',\n        borderColor: color,\n        marginRight: 10,\n      }}\n    >\n      <div style={{ height: 1000, width: 1000 }}>box</div>\n    </div>\n  );\n});\n\nconst Test = (props) => {\n  const redBoxRef = useRef<HTMLDivElement>();\n  const BlueBoxRef = useRef<HTMLDivElement>();\n  const BoxRef = useRef<HTMLDivElement>();\n  const [attribute, setAttribute] = useState('both');\n  useSyncScroll([redBoxRef, BlueBoxRef, BoxRef], attribute);\n  console.log(redBoxRef, BlueBoxRef);\n  return (\n    <>\n      <button onClick={() => setAttribute('both')}>both</button>\n      <button onClick={() => setAttribute('left')}>left</button>\n      <button onClick={() => setAttribute('top')}>top</button>\n      <p>attribute:{attribute}</p>\n      <div style={{ display: 'flex', justifyContent: 'flex-start' }}>\n        <Box ref={redBoxRef} color=\"red\" />\n        <Box ref={BlueBoxRef} color=\"blue\" />\n        <Box ref={BoxRef} color=\"BoxRef\" />\n      </div>\n    </>\n  );\n};\nexport default Test;",Ze='import React, { useState } from \'react\';\nimport { useBoolean, useThrottleFn } from \'wwhooks\';\n// import { useBoolean, useThrottleFn } from \'../../../\';\n\nexport default () => {\n  const [count, setCount] = useState<number>(0);\n  const [leading, leadingToggle] = useBoolean(false);\n  const [trailing, trailingToggle] = useBoolean(true);\n  const { run, cancel, flush } = useThrottleFn<() => void>(\n    () => {\n      setCount((state) => ++state);\n    },\n    1000,\n    { leading: leading, trailing: trailing },\n  );\n  return (\n    <div>\n      <p>count : {count} </p>\n      <p>\n        <button type="button" onClick={() => run()}>\n          add\n        </button>\n        <button type="button" onClick={() => cancel()}>\n          cancel\n        </button>\n        <button type="button" onClick={() => flush()}>\n          flush\n        </button>\n      </p>\n      <p>\n        <button type="button" onClick={() => leadingToggle()}>\n          leading : {leading.toString()}\n        </button>\n        <button type="button" onClick={() => trailingToggle()}>\n          trailing : {trailing.toString()}\n        </button>\n      </p>\n    </div>\n  );\n};',Re="import React, { useState } from 'react';\nimport { useTimeoutFn } from 'wwhooks';\n\nexport default () => {\n  const [state, setState] = useState(1);\n  const plus1 = useTimeoutFn(() => {\n    setState((state) => ++state);\n  }, 2000);\n  const plus = useTimeoutFn(setState, 1000);\n\n  return (\n    <div>\n      <p>\n        <button onClick={plus1.run}>{plus1.waiting ? 'waiting' : 'run'}</button>\n        <button onClick={plus1.cancel} disabled={!plus1.waiting}>\n          cancel\n        </button>\n        <button onClick={() => plus.run(10)}>plus10</button>\n      </p>\n      <p style={{ marginTop: 16 }}> {state} </p>\n    </div>\n  );\n};",Te="import React from 'react';\nimport { useTitle } from 'wwhooks';\n\nexport default () => {\n  const [title, setTitle] = useTitle('Page Title');\n\n  return (\n    <div>\n      <p>{title}</p>\n      <input value={title} onChange={(e) => setTitle(e.target.value)} />\n    </div>\n  );\n};",Ie="import React, { useState } from 'react';\nimport { useTitle } from 'wwhooks';\n\nconst Component = () => {\n  const [title, setTitle] = useTitle('Page Title', true);\n\n  return (\n    <div>\n      <p> {title}</p>\n      <input value={title} onChange={(e) => setTitle(e.target.value)} />\n    </div>\n  );\n};\n\nexport default () => {\n  const [state, toggle] = useState(true);\n\n  return (\n    <>\n      <button type=\"button\" onClick={() => toggle((v) => !v)}>\n        {state ? 'unmount' : 'mount'}\n      </button>\n      {state && <Component />}\n    </>\n  );\n};",Le="import React from 'react';\nimport { useToggle } from 'wwhooks';\n\nexport default () => {\n  const [state, toggleState] = useToggle('left', 'right');\n  return (\n    <div>\n      <p>state:{state.toString()}</p>\n      <p>\n        <button type=\"button\" onClick={() => toggleState()}>\n          toggle\n        </button>\n      </p>\n    </div>\n  );\n};",Me="import React from 'react';\nimport { useBoolean, useUnmount } from 'wwhooks';\nimport { message } from 'antd';\n\nconst Component = () => {\n  useUnmount(() => {\n    message.success('unMount');\n  });\n  return <span>Hello World</span>;\n};\n\nexport default () => {\n  const [state, toggle] = useBoolean(true);\n\n  return (\n    <>\n      <button type=\"button\" onClick={() => toggle()}>\n        {state ? 'unmount' : 'mount'}\n      </button>\n      {state && <Component />}\n    </>\n  );\n};",je="import { useUpdate } from 'wwhooks';\nimport React from 'react';\n\nconst test = () => {\n  const update = useUpdate();\n  return (\n    <>\n      Time: {Date.now()}\n      <p>\n        <button onClick={update}>update</button>\n      </p>\n    </>\n  );\n};\nexport default test;",Fe="import React, { useEffect, useState } from 'react';\nimport { useUpdateEffect } from 'wwhooks';\n\nexport default () => {\n  const [depCount, setDepCount] = useState<number>(0);\n  const [effectCount, setEffectCount] = useState<number>(0);\n  const [updateCount, setUpdateCount] = useState<number>(0);\n  useEffect(() => {\n    setEffectCount((v) => ++v);\n  }, [depCount]);\n\n  useUpdateEffect(\n    (cur, pre) => {\n      setUpdateCount((v) => ++v);\n      console.log(cur, pre);\n    },\n    [depCount],\n  );\n\n  return (\n    <>\n      <p>effectCount: {effectCount}</p>\n      <p>updateCount: {updateCount}</p>\n      <p>\n        <button onClick={() => setDepCount((c) => ++c)}>update Deps</button>\n      </p>\n    </>\n  );\n};",De="import React, { useEffect, useState } from 'react';\nimport { useUpdateLayoutEffect } from 'wwhooks';\n\nexport default () => {\n  const [depCount, setDepCount] = useState<number>(0);\n  const [effectCount, setEffectCount] = useState<number>(0);\n  const [updateCount, setUpdateCount] = useState<number>(0);\n  useEffect(() => {\n    setEffectCount((v) => ++v);\n  }, [depCount]);\n\n  useUpdateLayoutEffect(\n    (cur, pre) => {\n      setUpdateCount((v) => ++v);\n      console.log(cur, pre);\n    },\n    [depCount],\n  );\n\n  return (\n    <>\n      <p>effectCount: {effectCount}</p>\n      <p>updateCount: {updateCount}</p>\n      <p>\n        <button onClick={() => setDepCount((c) => ++c)}>update Deps</button>\n      </p>\n    </>\n  );\n};",ze="import React from 'react';\nimport { useUrlState, useToggle } from 'wwhooks';\n\nexport default () => {\n  const [navigateMode, { toggle }] = useToggle<'push' | 'replace'>('push', 'replace');\n  const [state, actions] = useUrlState({ count: '1', test: '2' }, navigateMode);\n  return (\n    <>\n      <p>state:{state.get('count')}</p>\n      <p>navigateMode:{navigateMode}</p>\n      <p>\n\n        <button\n          onClick={() => actions.set('count', (data) => `${data}1`)}\n        >\n          add\n        </button>\n        <button onClick={() => actions.set('count', undefined)}>\n          remove count\n        </button>\n        <button onClick={() => actions.clear()}>\n          clear\n        </button>\n      </p>\n      <p>\n        <button onClick={() => { toggle() }}>toggle navigateMode</button>\n      </p>\n    </>\n  );\n};",Ue="import { InputNumber } from 'antd';\nimport React, { useRef, useState } from 'react';\nimport useVirtualList from '..';\n\nconst mockList = [];\nlet key = 0;\nfor (let i = 0; i < 99999; i++) {\n  const value = 30;\n  key++;\n  mockList.push({\n    value,\n    key,\n  });\n}\n\nexport default () => {\n  const containerRef = useRef<HTMLDivElement>();\n  const {\n    list: cells,\n    wrapperStyle,\n    scrollTo,\n  } = useVirtualList(mockList, containerRef, 30);\n  const [index, setIndex] = useState(0);\n\n  return (\n    <>\n      <InputNumber onChange={(v) => setIndex(v as number)} />\n      <button\n        onClick={() => {\n          scrollTo(index);\n        }}\n      >\n        scrollTo\n      </button>\n      <div ref={containerRef} style={{ height: 400, overflow: 'auto' }}>\n        <div style={wrapperStyle}>\n          {cells.map((cell, index) => {\n            return (\n              <div\n                key={index}\n                style={{\n                  height: cell.data.value,\n                  display: 'flex',\n                  justifyContent: 'center',\n                  alignItems: 'center',\n                  border: '1px solid #e8e8e8',\n                }}\n              >\n                row:{cell.index}:{cell.data.value}\n              </div>\n            );\n          })}\n        </div>\n      </div>\n    </>\n  );\n};",Be="import {\n  CSSProperties,\n  MutableRefObject,\n  useLayoutEffect,\n  useMemo,\n  useState,\n} from 'react';\nimport useScroll from '../useScroll';\nimport useSize from '../useSize';\nimport usePersistFn from '../usePersistFn';\n\nexport default <T = any>(\n  originalList: T[],\n  containerRef: MutableRefObject<Element>,\n  itemHeight: number,\n) => {\n  const { height: containerHeight } = useSize(\n    containerRef as MutableRefObject<HTMLElement>,\n  );\n  const { top } = useScroll(containerRef);\n  const [rowIndex, setRowIndex] = useState({ start: 0, end: 0 });\n  const marginTop = useMemo(() => {\n    return itemHeight * rowIndex.start;\n  }, [itemHeight, rowIndex.start]);\n\n  const calculateRowRange = usePersistFn(() => {\n    if (\n      top >= Math.max(itemHeight * rowIndex.start - containerHeight, 0) ||\n      top <= rowIndex.end * itemHeight\n    ) {\n      const start = Math.max(0, Math.floor(top / itemHeight));\n      const end = Math.min(\n        originalList.length,\n        start + Math.ceil(containerHeight / itemHeight),\n      );\n      setRowIndex({\n        start,\n        end,\n      });\n    }\n  });\n\n  useLayoutEffect(() => {\n    calculateRowRange();\n  }, [top, containerHeight, originalList]);\n\n  const list = useMemo(() => {\n    return originalList\n      .slice(rowIndex.start, rowIndex.end)\n      .map((ele, index) => ({\n        data: ele,\n        index: index + rowIndex.start,\n      }));\n  }, [originalList, rowIndex.end, rowIndex.start]);\n\n  const totalHeight = useMemo(() => {\n    return itemHeight * originalList.length - marginTop;\n  }, [itemHeight, marginTop, originalList.length]);\n\n  const scrollTo = usePersistFn((index: number) => {\n    const container = containerRef.current;\n    if (container) {\n      container.scrollTop = itemHeight * index;\n    }\n  });\n\n  return {\n    list,\n    wrapperStyle: {\n      marginTop,\n      height: totalHeight,\n    } as CSSProperties,\n    scrollTo,\n  } as const;\n};",Ve="import React, { useRef, useState } from 'react';\nimport { useVisible } from 'wwhooks';\n\nexport default () => {\n  const ref = useRef();\n  const visible = useVisible(ref);\n  const [isTop, setIsTopRef] = useState(false);\n  console.log(visible);\n  return (\n    <div>\n      <div style={{ height: 200, width: 200, overflow: 'scroll' }}>\n        <div ref={isTop ? ref : undefined}>Top </div>\n        <div style={{ height: 300 }} />\n        <div ref={isTop ? undefined : ref}>bottom </div>\n      </div>\n      <p>\n        <button onClick={() => setIsTopRef((v) => !v)}>toggleRef</button>\n        <p>visible:{JSON.stringify(visible)}</p>\n        <p>ref:{isTop ? 'top' : 'bottom'}</p>\n      </p>\n    </div>\n  );\n};",He="import React from 'react';\nimport { useVisible } from 'wwhooks';\n\nexport default () => {\n  // \u8fd9\u6837\u5199\u65e0\u6cd5\u83b7\u53d6\u5230\u8282\u70b9\n  // const visible2 = useVisible( document.querySelector('#demo2'));\n  const visible = useVisible<Element>(() => document.getElementById('demo2'));\n  return (\n    <div>\n      <div style={{ height: 200, width: 200, overflow: 'scroll' }}>\n        <div id=\"demo2\">observer dom</div>\n        <div style={{ height: 300 }} />\n      </div>\n      <p>visible:{JSON.stringify(visible)}</p>\n    </div>\n  );\n};",Ke="import React from 'react';\nimport useWindowIsScroll from '..';\n\nexport default () => {\n  const isScrollState = useWindowIsScroll();\n\n  return (\n    <>\n      <p>x : {isScrollState.x.toString()}</p>\n      <p>y : {isScrollState.y.toString()}</p>\n    </>\n  );\n};",qe="import { useState } from 'react';\nimport useEventListener from '../useEventListener';\n\nexport interface ScrollS